      <BrowserRouter>
      <NavBar />
        <div className="container" style={{padding: "20px"}}>
          <Routes>
            <Route path="/" exact element= {<Home />} />
            <Route path="/CreateAccount/" element={<CreateAccount />} />
            <Route path="/login/" element={<Login />} />
